import logo from './uiimage.png';
import './App.css';

function App() {
  return (
    <div className="App">
       <img src={logo} className="App-image"  alt="logo"/>  
       <Headers className="App.text">
       <h1>Stunning Ui/Ux design </h1>
       </Headers>

    </div>
  );
}

export default App;
